   // console.log(this.props.history.match.params.id);
 
  render() 
  
  {
    return (
     
       
     
		<div class="header-admin topsidebar">
		<div class="container-fluid">
			<div class="row">
				<div class="col-md-12">
					<div className="col-md-4">
					<h3>Quản Lý Quán Cà Phê</h3>
					</div>
					<div className="col-md-8">
					
					<div className="float-right">
						<h1>sa</h1>
					<ul class="nav navbar-nav ">
						<li class=" dropdown">
							
        				<a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Xin chào Admin</a>
				        <div class="dropdown-menu" aria-labelledby="navbarDropdown">
				          <a class="dropdown-item" href="#">Đăng xuất</a>
				          <a class="dropdown-item" href="#">Tài khoản</a>
				        </div>
      					</li>
					</ul>
					</div>
		
					</div>
					
				</div>
			</div>
		</div>
	</div>
       
      
     
    );
  }
}

export default Header;
